import React from "react";
import { AvatarBlock } from "./AvatarBlock";
import { AvatarGroupWrapper } from "./AvatarGroupWrapper";
import { CardGrid } from "./CardGrid";
import { Group } from "./Group";
import line1 from "./line-1.svg";
import "./style.css";

export const MenuPrincipal = () => {
    return (
        <div className="menu">
            <div className="overlap-group-wrapper">
                <div className="overlap-group">
                    <img className="line" alt="Line" src={line1} />

                    <div className="examples-home-page">
                        <AvatarBlock
                            avatarTypeImageSizeClassName="avatar-block-4"
                            className="avatar-block-3"
                            description="Descrição"
                            divClassName="avatar-block-5"
                            title="Nome Completo"
                        />
                        <div className="section">
                            <p className="p">
                                Crie enquetes, vote e acompanhe os resultados. Simples, rápido e
                                aberto para todos!
                            </p>
                        </div>

                        <CardGrid
                            className="card-grid-testimonials"
                            platform="desktop"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperDivClassName="card-grid-2"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperDivClassNameOverride="card-grid-3"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperTypeImageSizeClassName="card-grid-instance"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperTypeImageSizeClassName1="card-grid-4"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperTypeImageSizeClassName2="card-grid-5"
                            // testimonialCardAvatarBlockWrapperTypeImageSizeWrapperTypeImageSizeClassNameOverride="card-grid-testimonials-instance"
                            testimonialCardTextHeadingText="Melhor série do momento"
                            testimonialCardTextHeadingText1="A rede social mais viciante"
                            testimonialCardTextHeadingText2="Melhor destino para viajar"
                            testimonialCardTextHeadingText3="Curte músicas clássicas?"
                            testimonialCardTextHeadingText4="Livros físicos ou digitais?"
                            testimonialCardTextHeadingText5="Prefere dias chuvosos?"
                            textContentHeadingHeading="Votações em Aberto"
                            textContentHeadingSubheading="Selecione o seu interesse e faça sua votação"
                        />
                    </div>

                    <Group className="group-2" />
                    {/*<AvatarGroupWrapper className="avatar-group-5" />*/}
                </div>
            </div>
        </div>
    );
};
